  [],\n\t\"revision_timestamp\": \"2016-08-15T20:27:18.329092\",\n\t\"name\": \"afsc-race-sap-swiney-effects-of-ocean-acidification-and-increased-temperatures-on-juvenile-red-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Multiple stressor studies are needed to
  better understand the effects of oceanic changes on marine organisms.  To determine
  the effects of near-future ocean acidification and warming temperature on juvenile
  red king crab (Paralithodes camtschaticus) survival, growth, and morphology, we
  conducted a long-term (184 d) fully crossed experiment with two pHs and three temperatures:
  ambient pH (~7.99), pH 7.8, ambient temperature, ambient +2 degree C, and ambient
  +4 degree C, for a total of 6 treatments.\",\n\t\"license_title\": null,\n\t\"extras\":
